                    <p class="note rtli-h15-x rtli-pt-pico" id="rtlde-epg-pic-font">Sina erfhrt fassungslos, was Ronja wirklich geschehen ist. Entschlossen beschafft sie ihrer Nichte Hilfe, aber Ronja reagiert anders als erhofft. Stella soll fr Tobias beruflich die Stellung halten. Mit Pacos Hilfe widmet sie sich der Herausforderung, bis sie an anderer Stelle gebraucht wird. Als Tobias kurzfristig nach Berlin muss, will er Vivien den idealen Ersatz fr den Vorbereitungskurs besorgen. Seine Wahl erweist sich als heikel.</p>
                

