                                                        <div class="image rtli-pt-pico">
                        <img loading="lazy" src="//aisrtl-a.akamaihd.net/epgrtl/968221931/360x0/rtl-direkt.jpg"
                             alt="RTL Direkt" title="RTL Direkt">
                    </div>
                    <p class="note rtli-h15-x rtli-pt-pico" id="rtlde-epg-pic-font">Direkt ins Thema. Direkt dort, wo es passiert. Direkt gefragt - ohne Umwege: "RTL Direkt" ist nicht einfach ein weiteres Nachrichten- oder Talkformat. Die Sendung verbindet das Beste aus beiden Welten. Jan Hofer oder Pinar Atalay informieren am Abend kompakt, direkt und verstndlich und liefern dabei gemeinsam mit Studiogsten sowie einem Reporterteam einen umfassenden Blick auf die Themen, die Deutschland bewegen.</p>
                

            </a>

